import ProductList from './product-list';
import MustHavePreview from '../../HOMEPAGE/must-have-card/must-have-card.component';
import './must-have.style.css';

class MustHave extends Component {
    constructor(props) {
        super(props);

        this.state = {
            collections: ProductList
        };
    }
    render() {
        const {collections} = this.state;  
        return (
        <div className="must-have-page">
           <h1 className="must-have-page-title">MUST-HAVES</h1>
           <div className="must-have-page-product">

           </div>
        </div>

        );
    }

}


export default MustHave;
